<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>client.txt</title>
    <style>
        body {
            background-color: #333;
            color: #FF5555;
            font-family: 'Arial', sans-serif;
            text-align: center;
            margin: 0;
            padding: 0;
        }

        h1 {
            color: #FF5555;
            margin-bottom: 20px;
            font-size: 28px;
            display: inline-block;
        }

        p {
            color: #ddd;
            padding: 10px;
            font-size: 18px;
        }

        strong {
            padding: 0px 30px;
            color: #FF5555;
        }

        .box {
            white-space: pre-line;

            font-size: 18px;
            margin-top: 10px;
            padding: 10px;
            border: 1px solid #FF5555;
            border-radius: 5px;
            display: inline-block;
            animation: fadeIn 1s ease-out, moveDown 1s ease-out;
        }

        @keyframes fadeIn {
            0% {
                opacity: 0;
            }

            100% {
                opacity: 1;
            }
        }

        @keyframes moveDown {
            0% {
                transform: translateY(-20px);
            }

            100% {
                transform: translateY(0);
            }
        }

        h1::after {
            content: "client.txt";
            display: inline-block;
            animation: typing 2s steps(9, end), pop 0.5s ease-in-out 2s forwards;
        }

        @keyframes typing {
            0% {
                content: "c ";
            }

            11% {
                content: "cl|";
            }

            22% {
                content: "cli ";
            }

            33% {
                content: "clie|";
            }

            44% {
                content: "clien ";
            }

            55% {
                content: "client|";
            }

            66% {
                content: "client. ";
            }

            77% {
                content: "client.t|";
            }

            88% {
                content: "client.tx ";
            }

            100% {
                content: "client.txt|";
            }
        }

        @keyframes pop {
            0% {
                transform: scale(1);
            }

            50% {
                transform: scale(1.2);
            }

            100% {
                transform: scale(1);
            }
        }

        body.loaded .box {
            animation: coolAnimation 2s ease-in-out;
        }

        @keyframes coolAnimation {
            0% {
                transform: scale(1);
                background-color: #FF5555;
                color: #333;
            }

            50% {
                transform: scale(1.2);
                background-color: #333;
                color: #FF5555;
            }

            100% {
                transform: scale(1);
                background-color: #FF5555;
                color: #333;
            }
        }
    </style>
</head>
